create table peserta (
	id INT,
	nama_depan VARCHAR(50),
	nama_belakang VARCHAR(50),
	tgl_lahir DATE,
	alamat_rumah VARCHAR(50),
	kota VARCHAR(50),
	negara VARCHAR(50),
	kode_pos VARCHAR(50),
	kode_negara VARCHAR(50),
	email VARCHAR(50),
	no_telp VARCHAR(50),
	picture VARCHAR(50),
	tgl_daftar DATE,
	tgl_selesai DATE,
	username VARCHAR(50),
	password VARCHAR(50),
	status VARCHAR(50)
);
